INSERT INTO `events` VALUES ('1','Akraman','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/akraman.png\"  align=\"right\"/ style=\"padding-left:20px;\">Hacking is just like playing with other people making them do strange things. So we give you an opportunity to be the master puppeteer with a terminal and a keyboard at your disposal. Test your skills of survival in this mechanistic world. After all we believe in the saying:\"In God we trust,all others we virus scan.\" </p>',' <p align=\"justify\" style=\"font-size:14px;\" >  <img src=\"db images/akraman.png\"  align=\"right\" style=\"padding-left:20px;\">Akraman, will be a 5-hour long hacking competition, in which teams comprising of not more than two players will participate and test their hacking skills to the fullest in order to pass each obstacle set for them to win the competition. The game is designed with a skill set in mind. The game is composed of several stages, each boasting a unique challenge with varying difficulty. In order to clear one stage, teams will have to find answers to go to the next level. The first team to overcome the last hurdle will win the Akraman.<br/>   Structure of the contest:<br/>  This is a two level contest.<br/>  * First phase will be preliminary from which 20 teams will be selected for the main event on   the basis of a questionnaire.<br/>  * In main event there will be seven levels, the answer of one level will unlock the question for   the subsequent level.  </p>','<p align=\"justify\" style=\"font-size:14px;\" >  <img src=\"db images/akraman.png\"  align=\"right\" style=\"padding-left:20px;\"> 1. Each team should have a maximum of two members.<br/> 2. The answer of one level will unlock the question for the subsequent level.<br/> 3. The team that reaches the farthest level will be the winner.<br/> 4. In case of a tie the team that reached the farthest level earlier would be deemed as winner.<br/>     </p>','<br/> <br/> <br/> <br/> <br/>  <p align=\"justify\" style=\"font-size:14px;\" >     	   Contact Team Akraman : akraman@infotsav.org    </p> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/>','To be uploaded soon......',' <h4>â— A 16 hr Ethical Hacking & Information Security Workshop on 29th - 30th Oct during Infotsav by Kyrion Technologies.</h4><br/>   <h4>â— A 2 days workshop on Automobile Mechanics & Engine Design by Emanagineer India.</h4><br/>   <h4>â— A session by Yashwant Kanetkar , the renowed author of \"Let Us C\" and more.</h4><br/>   <h4>â— Registration will start from 1st September 2010</h4><br/>','Akraman .....The Hacking Contest'),('2','Code Wars','<p align=\"justify\" style=\"font-size:14px;\" >  <img src=\"db images/codewars.png\"  align=\"right\" style=\"padding-left:20px;\">  Code Wars\" the ultimate programmer\'s game requires you to program your bots so that they may capture and deposit the flag of their opponent in a predefined environment. Your program can make your bot to move, scan the arena for enemies, throw bombs, send message to its other team bots, etc. Two such programs will be made to fight with each other. So only the best program will win. So get going and program for the ultimate battle of codes. 	   </p>',' <p align=\"justify\" style=\"font-size:14px;\" >  <img src=\"db images/codewars.png\"  align=\"right\" style=\"padding-left:20px;\">  1. A participant must write the driving code of the bots in C or C++.<br/> 2. There must be three programs, one for each bot compiled and the executive file should     be named bot1, bot2 and bot3.<br/> 3. Although for testing purposes the participant may write code for bot4, bot5 and bot6 and     check his/her programs efficiency.<br/> 4. Kindly send your program only for bot 1,2 and3. The team id must be 1.<br/> 5. Sample programming codes are given under bot1-6 of the downloadable zip or tar file.<br/>   </p>','<p align=\"justify\" style=\"font-size:14px;\" >  <img src=\"db images/codewars.png\"  align=\"right\" style=\"padding-left:20px;\">  1. The arena is divided in two sections, one for each team.<br/> 2. Bots do not collide. They simply pass through each other.<br/> 3. A bot can kill another bot by shooting it.<br/> 4. Bot that has captured the enemy flag has to deposit it at specified coordinates different     for each player.<br/> 5. If a bot carrying a flag is hit by another bot the flag can be carried by any of the bots.<br/> 6. After deposition of the flag, a new flag will appear at its original location.<br/> 7. Each bot originates at a particular coordinate with 100 health.<br/> 8. A bot dies if its health points are exhausted.<br/> 9. There is life after death!! A bot that dies will reappear with 100 health pts., but will lose     points from the score.<br/> 10. A bot is deactivated (removed from the arena) if its driving program terminates     (normally or abnormally) or it makes an unusu','<p align=\"justify\" style=\"font-size:14px;\">     	     Anurag Agrawal<br/> +91 9425787381 <br/><br/>      		  Arpit S Gupta<br/> +91 9425792494 <br/><br/>   	 		  Sanjay Kumar<br/> +91 903968778<br/><br/>  	  	  		    Contact Team Codewars: codewars@infotsav.org        </p>','To be uploaded soon...',' <h4>â— A 16 hr Ethical Hacking & Information Security Workshop on 29th - 30th Oct during Infotsav by Kyrion Technologies.</h4><br/>   <h4>â— A 2 days workshop on Automobile Mechanics & Engine Design by Emanagineer India.</h4><br/>   <h4>â— A session by Yashwant Kanetkar , the renowed author of \"Let Us C\" and more.</h4><br/>   <h4>â— Registration will start from 1st September 2010</h4><br/>','Code Wars . . . The Bot Programming Contest'),('3','Code Weavers','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/codeweavers.png\"  align=\"right\" style=\"padding-left:20px;\">  Code Weavers is the annual online programming contest of IIITM Gwalior, organized as a part of Infotsav with immense participation from national and international teams. <br/> Dependence of our lives on 1s and 0s has become inevitable in today\'s world and coding is the basic entity of it. But remember, there are <strong>0010 ways to write an error free code and only the 0011 rd one works</strong>. The master is the one who follows the third method to rule the eternal digital world. <br/> C/C++ or Java will be the only tools of trade here with an equal mix of logic, intellect and speed being the main requisite for success.<br/> </p>',' <p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/codeweavers.png\"  align=\"right\" style=\"padding-left:20px;\">     This year also a set of demanding problems awaits one and the standard has only got tougher and tougher. In this grueling test the more one solves, the higher he or she scores.</p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/codeweavers.png\"  align=\"right\"/ style=\"padding-left:20px;\"> <strong> 1.</strong> Teams can participate with a maximum of 3 members.<br/> <strong>2.</strong> The contest is only open for students currently registered in a university.<br/> <strong>3.</strong> Permissible languages to submit solutions in, are:   C, C++ , Java<br/> <strong>4.</strong> Compilers to be used: <br/>gcc (gcc (GCC) 4.1.2) for C <br/> g++ (g++ (GCC) 4.1.2) for C++ <br/>    j2sdk1.5.0 (javac 1.5.0_10) for Java. <strong>5.</strong>Invoked as:<br/>   gcc -O -w -static -o probX probX.c -lm<br/>   g++ -O -w -static -o probX probX.cpp -lm<br/>   javac -nowarn -Xmaxerrs 1 probX.java; java probX<br/> <strong>6.</strong> Submission has to be done in proper format, failing which the entries shall not be    accepted.<br/> <strong>7.</strong> If any team(s) are found to copy source code of other teams, that team will be    immediately disqualified.<br/> <strong>8.</strong> Any team which attempt to hack/deliberately crash the judging system will be immediately disqualified.<br/> <strong>9.</strong> The decision of the organizers in declaring the results will be final and will be binding on all. No queries in this regard will be entertained.  </p> 	   ','<p align=\"justify\" style=\"font-size:14px;\">         Aayas Tiwari<br/>    +91 919755735789<br/><br/>  	    Rohit Anand<br/> +91 9009858110 <br/><br/> <br/> 	       Contact Team Code-Weavers: codeweavers@infotsav.org        </p>','',' <h4>â— A 16 hr Ethical Hacking & Information Security Workshop on 29th - 30th Oct during Infotsav by Kyrion Technologies.</h4><br/>   <h4>â— A 2 days workshop on Automobile Mechanics & Engine Design by Emanagineer India.</h4><br/>   <h4>â— A session by Yashwant Kanetkar , the renowed author of \"Let Us C\" and more.</h4><br/>   <h4>â— Registration will start from 1st September 2010</h4><br/>','Code Weavers . . . The Programming Contest'),('4','Enigma',' <h3>\"Knowledge along with awareness will unfold the mysteries of technology\"</h3>    <p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/enigma.png\"  align=\"right\" style=\"padding-left:20px;\"> ENIGMA is mysterious technical quiz organized under INFOTAV annual technical fest of ABV-IIITM Gwalior. This quiz will test the basic knowledge, awareness and understanding of participants regarding Information Technology And Communication.<br/> Knowledge of recent updates in the newer emerging technologies will be tested. Every year this event is top hotspot for web surfers, so receives a huge response from colleges all over India. The magnitude of response can be expected to shot through the sky this year too.           </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/enigma.png\"  align=\"right\" style=\"padding-left:20px;\">      <br/>The event consists of three rounds viz. Elimination round, Pre Final and Final round.<br/> Elimination round and pre final round will online while final round is to be held onsite.<br/> The number of questions in each round will be as follows:<br/> 40 Questions Marking: +5 (correct),-2(incorrect) <br/><br/>  <br/>    </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/enigma.png\"  align=\"right\"/ style=\"padding-left:20px;\"> The quiz will be held online.Date and time of the event will be released soon; keep checking the website for further updates.<br/>      <strong>1.</strong> A team can consist of maximum 2 participants.<br/> 	 <strong>2.</strong> The nature of questions will be objective<br/> 	  <strong>3.</strong>There might be multiple choice questions<br/>  	  <strong>4.</strong> Teams will be eliminated on level score instead total score of each level<br/> 	   <strong>5.</strong> In case of any dispute the decision of organizers will be regarded final.<br/> 	   </p> 	  ','<p align=\"justify\" style=\"font-size:14px;\">     Naveen Jaiswal<br/> +91 9203009291 <br/><br/>   Tushar Kakkar<br/> +91 9406976061 <br/><br/>     Vikas Gupta<br/> +91 8109730005 <br/><br/>       Contact Team Enigma: enigma@infotsav.org  </p> 	 ','',' <h4>â— A 16 hr Ethical Hacking & Information Security Workshop on 29th - 30th Oct during Infotsav by Kyrion Technologies.</h4><br/>   <h4>â— A 2 days workshop on Automobile Mechanics & Engine Design by Emanagineer India.</h4><br/>   <h4>â— A session by Yashwant Kanetkar , the renowed author of \"Let Us C\" and more.</h4><br/>   <h4>â— Registration will start from 1st September 2010</h4><br/>','Enigma . . . The IT Quiz'),('5','La Ingenious','<p align=\"justify\"><strong>La-Ingenious</strong> is  the software contest under the umbrella of Infotsav 2010. It is one of the most  accolades winning technical event of the festival providing a platform to judge  the feasibility and usefulness of software. In fact itâ€™s an opportunity for all  those who have the ability to carve their stimulating ideas into creating  path-breaking software.\r\n  </p>\r\n<p align=\"justify\">This event has been collaborated with <strong>SF-FOSS (Students Forum for Free Open Source Software)</strong> which has  collaborations with <strong>NRC-FOSS</strong> and <strong>SUN MICROSYSTEMS</strong>.\r\n  </p>\r\n<p align=\"center\"><strong>\"Creativity is thinking up new  things. Innovation is doing new things..\" </strong></p>\r\n<p align=\"justify\">\r\n  Integrate technology with creativity  and innovations that reflects the talent in you to excel and leave an impact.  This event showcases the talent of students to bring out the best in them to  create and excel. All you have to do is to develop software. Rest will follow  automatically...</p>','<p><strong><u>Phase  1: Online</u></strong></p>\r\n <p align=\"justify\">The registration and submission of abstracts has  started. The last date of abstract submission is 10th October 2010. <strong>Please submit your abstract as per the  format which is available in the download section.</strong></p>\r\n\r\n<p><strong><u>Phase 2: Online</u></strong></p>\r\n <p align=\"justify\"> Teams would be selected directly for the on-campus round  based on their abstracts. They will be informed via e-mail and will be provided  full detail about hospitality and other concerns. </p>\r\n<p><strong><u>Phase 3: On-Campus Round</u></strong></p>\r\n <p align=\"justify\"> All the selected teams will get a chance to present their software  during Infotsav 2010(29th to 31st October, 2010). The selected teams for the  on-campus round have to give the confirmation of their arrival for the  on-campus competition. </p>','<p align=\"justify\">\r\n  â— The event will take place in 3 phases.<br /><br />\r\n\r\n\r\n  â— Students currently pursuing education in a  recognized institute are allowed to participate in the event. <br />\r\n  <br />\r\n\r\n â— Students from different colleges can form a  single team.<br />\r\n <br />\r\n\r\n  <strong>â— Team Size</strong>:  Maximum Team Size shall be <strong>4</strong>.<br />\r\n  <br />\r\n\r\n  â— Teams are required to register at <a href=\"http://infotsav.org\">Infotsav 2010 website. </a><br />\r\n  <br />\r\n\r\n<br />\r\n â— All teams have to mail Â the abstract of their project to <a href=\"mailto:laingenious@infotsav.org\">laingenious@infotsav.org</a>\r\n <strong>Please  submit your abstract as per the format which is available in the download  section.</strong><br />\r\n <br />\r\n\r\n  â— Abstract should not exceed 5 pages (Font: Times  New Roman/Arial, Size : 11 Points)<br />\r\n  <br />\r\n\r\n\r\nâ— Teams would be selected directly for the on-campus round based on their abstracts. They will be informed via e-mail and will be provided full detail about hospitality and other concerns.<br />\r\n</p>','<p align=\"justify\" style=\"font-size:14px;\">    Abhishek Anand<br/> +91 8103886801 <br/><br/>     Manav Singhal<br/> +91 9977700674 <br/><br/>      Nishant Rai<br/> +91 7879201705<br/><br/>      Ritesh Dhandotia<br/> +91 9425115350 <br/><br/>  	Shilpi Agrawal<br/>      +91 9770387036 <br/><br/>   	 Contact Team LaIngenious: laingenious@infotsav.org  </p>',' <a href=\"Downloads/Laingenious/Rule book.pdf\"><table width=\"100%\" border=\"0\">\r\n  <tr>\r\n    <td width=\"2%\"><img src=\"images/dn.gif\" width=\"19\" height=\"17\" /></td>\r\n    <td width=\"98%\">Information Brouchure</td>\r\n  </tr>\r\n</table>\r\n</a>\r\n <a href=\"Downloads/Laingenious/Abstract Format.pdf\"><table width=\"100%\" border=\"0\">\r\n  <tr>\r\n    <td width=\"2%\"><img src=\"images/dn.gif\" width=\"19\" height=\"17\" /></td>\r\n    <td width=\"98%\">Abstract Format</td>\r\n  </tr>\r\n</table>\r\n</a>',' <h4>â—Please submit your abstract as per the format which is available in the download section.</h4><br/> <h4>â— The Abstract Submission for La Ingenious has started.</h4><br/>   <h4>â— Submit your abstracts to laingenious[at]infotsav[dot]org.</h4><br/>   <h4>â— The last date of Abstract Submission is 10th October 2010.</h4><br/>   <h4>â— Download Laingenious Rules book from download section.</h4><br/>','La Ingenious . . . The Open Software Contest '),('6','Web Mania',' <p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/web.png\"  align=\"right\" style=\"padding-left:20px;\"> Information attracts attention if it is well presented and has a good layout. One of the finest way of bringing thoughts and information in front of the world in todays world is to bring those thoughts through the web and it is the designing of these web pages that may attract people to read the information.<br />  With the event web mania we bring forward a chance for you to try your imagination and try your hands in the fascinating field of web designing. Try to be articulate in whatever you do .Do it fast and do it perfectly. Be a professional designer, know the psychology of color So, grab this opportunity with both your hands and test your skills @ Web Mania     </p>','<table width=\"100%\" border=\"0\">\r\n  <tr>\r\n    <td>Phase 1:</td>\r\n    <td> </td>\r\n  </tr>\r\n  <tr>\r\n    <td>1. Start of Round 1:</td>\r\n    <td>23rd September 2010</td>\r\n  </tr>\r\n  <tr>\r\n    <td>2. Deadline for Submission:</td>\r\n    <td>10th October 2010</td>\r\n  </tr>\r\n  <tr>\r\n    <td>3. Declaration of Results:</td>\r\n    <td>15th October 2010</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Phase 2:</td>\r\n    <td> </td>\r\n  </tr>\r\n  <tr>\r\n    <td>1. Start of Round 2:</td>\r\n    <td> 29th October 2010</td>\r\n  </tr>\r\n  <tr>\r\n    <td>2. Deadline for Submission:</td>\r\n    <td>30th October 2010</td>\r\n  </tr>\r\n  <tr>\r\n    <td>3. Declaration Of Results:</td>\r\n    <td>31st October2010</td>\r\n  </tr>\r\n</table>\r\n\r\n','\r\n\r\n<li><strong>Rules for Phase 1:</strong>\r\n  					<ul>\r\n  						<li>1. The participants must choose from the topics given below:\r\n						<li>a. Cultural Fest</li>\r\n						<li>b. Sports CLUB</li>\r\n						<li>c. Tourism Portal</li></li>\r\n  						\r\n  					</ul>\r\n					<ul><li>2. The participants will be required to submit the website with the source code and supporting documents (if any).</li></ul>\r\n					<ul><li>3. The team size cannot be larger than 3 members although a team of two or an individual can also participate in the event.</li></ul>\r\n					<ul><li>4. The participants are not allowed to use CMS such as Drupal or Joomla.</li></ul>\r\n					<ul><li>5. The top 10 teams from phase 1 will be selected for phase2 .</li></ul>\r\n					<ul><li>6. The decision of the judges and the organizers will be final.</li></ul>\r\n					<ul><li>7. The contestants are requested to strictly adhere to the deadlines.</li></ul>\r\n					<ul><li>8. The websites must be mailed to webmania@infotsav.org</li></ul>\r\n					<ul><li>9. Any changes in the deadlines would be immediately reflected on our website http://www.infotsav.org.</li></ul>\r\n					\r\n					\r\n</li>\r\n\r\n\r\n\r\n<li><strong>Rules for Phase 2:</strong>\r\n  					<ul><li>1.  Only the top 10 teams selected from phase1 would be eligible to participate in phase2 of the event.</li></ul>\r\n					<ul><li>2. This phase will be held on-campus at ABV-IIITM during Infotsav 2010.</li></ul>\r\n					<ul><li>3. The participants will be given a case on the day of the event itself.</li></ul>\r\n					<ul><li>4. The participants will have to prepare a website within 24hrs from the start of the event.</li></ul>\r\n					<ul><li>5. The participants will not be allowed to use CMS.</li></ul>\r\n					<ul><li>6. The decision of the judges would be final.</li></ul>\r\n					\r\n					\r\n</li>','<p align=\"justify\" style=\"font-size:14px;\">      Ishan Gupta<br/> +91 9329550595 <br/><br/>      Phani Kumar <br/> +91 9009989099 <br/><br/>  	   	   	  Pranshu Verma<br/> 	+91  9425915569 <br/><br/> </p>','<strong>Â» Download the Cases :</strong> <br />\r\n<br/><br/>\r\n<p align=\"justify\">The Cases for the first round have been uploaded.Please download the Web Mania pdf to get all the details.</p>\r\n<br/><br/>\r\n<table width=\"100%\" border=\"0\"> \r\n  <tr>\r\n    <td width=\"2%\"><a href=\"Downloads/Webmania/Web_Mania.pdf\" target=\"_blank\"><img src=\"images/dn.gif\" width=\"19\" height=\"17\" /></a></td>\r\n    <td width=\"98%\"><a href=\"Downloads/Webmania/Web_Mania.pdf\" target=\"_blank\">Web Mania Cases</a></td>\r\n  </tr>\r\n </table>\r\n <br/><br/><br/><br/><br/><br/>\r\n \r\n','<h4>â— The Cases for the First Phase have been uploaded.Please download the case details.</h4><br/> \r\n<h4>â— The first round starts from 23rd September 2010</h4><br/>  \r\n<h4>â— Deadline for the submission for the first round is 10th October 2010</h4><br/>  \r\n','Web Mania . . . The Web Designing Contest '),('7','Witch Hunt',' <p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/witch.png\"  align=\"right\" style=\"padding-left:20px;\"> Witch Hunt, one of the technical events, being organized under the umbrella of Infotsav 2010, is a Debugging contest. It puts your programming skills at the ALTERS. <br/>          Programming isn\'t all about just Coding, it is much more beyond that. For Programmers, Debugging errors may be hard to crack and this situation becomes worse when it is associated with memory locations. So, grasp the challenge to battle out your opponents. Debugging is twice as hard as writing the code in the first place. Therefore, if you write the code as cleverly as possible, you are, by definition, not smart enough to debug it. Debugging, particularly debugging of other peoples code, is a skill separate from the ability to write a new program. For this, check your skills in Debugging arena (Witch Hunt) by cracking worst known debugging errors. It will expose you to different levels of problems crept with errors. It\'s the time to show your debugging talent. Come be a part of this Technically Jubilant Module of Infotsav 2010.    </p>','  <p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/witch.png\"  align=\"right\"/ style=\"padding-left:20px;\"> Debugging is the process of locating and fixing or bypassing bugs (errors) in computer program code. To debug a program, isolate the source of the problem, and then fix it. A practicing programmer inevitably spends a lot of time tracking down and fixing bugs. Debugging, particularly debugging of other people\'s code, is a skill separate from the ability to write new program. Unfortunately, debugging is often practiced, it is rarely taught. A typical course in debugging techniques consists of reading the manual for a debugger. Here you have got a chance to show your mind power, technical skills.<br/> \"Perfection is achieved when you have nothing more to add , but when you have nothing left to take away .For this , the teams are sent on a seek and destroy mission , where the arena is code, the opponents are bugs and the weapons are tools.\"    </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/witch.png\"  align=\"right\"/ style=\"padding-left:20px;\"> <strong>1.</strong> Teams can participate with a maximum of 2 members.<br/> <strong>2.</strong> Only submissions which reach us within the time limit (decided by the Witch Hunt Team)     will be evaluated (unless the duration is extended).<br/> <strong>3.</strong> Submissions should be done in the same order as the question appear. You aren\'t     allowed to skip a question and return to it later.<br/> <strong>4.</strong> First Phase will consist of three rounds- First round will consist of multiple choice     questions(only one correct) with negative(-) marking.Second round will consist of     multiple choice questions(one or more than one correct) with no negative(-)marking.     Third round will consist of submit type questions with no negative(-) marking.<br/> <strong>5.</strong> Number of questions & duration will be disclosed at the time game starts.<br/> <strong>',' <p align=\"justify\" style=\"font-size:14px;\">    Adnan Mehboob<br/> +91 9301105710 <br/><br/>    Harish Ghodki<br/> +91 9424418428 <br/><br/>      Tushar Sharma<br/> +91 9406970545 <br/><br/>  	 	   Contact Team WitchHunt: witchhunt@infotsav.org   </p>','',' <h4>&#9679 A 16 hr Ethical Hacking & Information Security Workshop on 29th - 30th Oct during Infotsav by Kyrion Technologies.</h4><br/>   <h4>&#9679 A 2 days workshop on Automobile Mechanics & Engine Design by Emanagineer India.</h4><br/>   <h4>&#9679 A session by Yashwant Kanetkar , the renowed author of \"Let Us C\" and more.</h4><br/>   <h4>&#9679 Registration will start from 23rd August 2010</h4><br/>','Witch Hunt  . . . The Debugging Contest '),('8','Acumen','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/acumen.png\"  align=\"right\"/ style=\"padding-left:20px;\">  From bears to bulls, products to advertisements, managers to entrepreneurs, economy to economists and business to technology all will make you scratch your head. Acumen is not just a trivia of business questions with different varied rounds and sections. Here not only future managers or entrepreneurs prove their might with the nick of time, but also all the technogeeks join the battle to prove that technology and business are inseparable.<br/> Come the battle ground is waiting to hear the roaring of future corporate professionals. So the time is ticking to reveal soon who will be the next biz master. 	    </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/acumen.png\"  align=\"right\"/ style=\"padding-left:20px;\">  Acumen is the Business Quiz in Infotsav. It is mainly intended to test the business knowledge of the Management students. Engineering and Management Students are invited to participate in the event. Teams can register by mailing to acumen@infotsav.org by giving their Names, Institute Name and Contact Nos.     </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/acumen.png\"  align=\"right\"/ style=\"padding-left:20px;\">  <strong>1.</strong> A Team can comprise of maximum two members.<br/> <strong>2.</strong> A prelims round on objective based format would be conducted.<br/> <strong>3.</strong> The top five Teams of the prelims round would be playing the mains round which would     comprise of Five Sub Rounds. Details of these rounds would be given during the mains     session itself.<br/> <strong>4.</strong> At Any stage the Quiz Master\'s Decision is Final. <br/>  </p>','<p align=\"justify\" style=\"font-size:14px;\">   Contact Team Acumen: acumen@infotsav.org  </p>','',' <h4>&#9679 A 16 hr Ethical Hacking & Information Security Workshop on 29th - 30th Oct during Infotsav by Kyrion Technologies.</h4><br/>   <h4>&#9679 A 2 days workshop on Automobile Mechanics & Engine Design by Emanagineer India.</h4><br/>   <h4>&#9679 A session by Yashwant Kanetkar , the renowed author of \"Let Us C\" and more.</h4><br/>   <h4>&#9679 Registration will start from 23rd August 2010</h4><br/>','Acumen . . . The Business Quiz'),('9','Analyst','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/analyst.png\"  align=\"right\"/ style=\"padding-left:20px;\"> Analyst-The Case Study Event is all about judging your intellect, managerial skills and ability to craft sustainable solutions to problems that organizations face today. If you can strain you nerve and sinew, and come up with solutions that are practical and implementable, Analyst has a place for you. Challenging live cases from some great ventures await your sight, who knows... may be you can make a difference! Analyst this year comes with interesting cases, mind- boggling reasoning and some big people to judge your acumen and innovation. Come join those who wish to provide street-smart, real-time feasible solutions and to prove themselves a true Analyst.  </p>',' <p align=\"justify\" style=\"font-size:14px;\">   <table width=\"100%\" border=\"0\">\r\n  <tr align=\"left\">\r\n    <th scope=\"col\" width=\"50%\">Preliminary Phase:</th>\r\n    <th scope=\"col\">Â </th>\r\n  </tr>\r\n  <tr>\r\n    <td>Case to be uploaded on :</td>\r\n    <td>20th September, 2010.</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Deadline for submission :</td>\r\n    <td>1st October, 2010.</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Results of Preliminary Phase :</td>\r\n    <td>5th October, 2010.</td>\r\n  </tr>\r\n</table>\r\n\r\n	\r\n	<br />\r\n<br />\r\n\r\n<table width=\"100%\" border=\"0\">\r\n  <tr align=\"left\">\r\n    <th scope=\"col\" width=\"50%\">Final Phase</th>\r\n    <th scope=\"col\">Â </th>\r\n  </tr>\r\n  <tr>\r\n    <td>Presentation on-campus :</td>\r\n    <td>29th October, 2010.</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Enclosure of Live-Case :</td>\r\n    <td>After the Completion of Presentations.</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Dead-line for the submission :</td>\r\n    <td>30th October, 2010.</td>\r\n  </tr>\r\n</table>\r\n\r\n  </p>','<ol>\r\n <strong>General Rules :</strong>\r\n<li>â—The maximum size  of a team is four.</li>\r\n<li>â—Students from different institutes can form a team</li>\r\n<li>â—No student can be a part of more than one team.</li>\r\n<li>â—A team cannot submit multiple entries</li>\r\n<li>â—The event will be conducted in 2 phases â€“ The Preliminary Phase and the Final Phase.</li>\r\n<li>â—The Solution to the case of the Preliminary phase is to be submitted online.</li>\r\n<li>â—The Final Phase is an on-campus phase conducted at IIITM, Gwalior.</li>\r\n<li>â—Participant can choose to provide solution to any one of the case uploaded in the downloads link.</li>\r\n</ol>\r\n<br/>\r\n<ol>\r\n<strong>Rules for preliminary(short listing) phase</strong><br/> \r\n<li>â— Entries in the PDF format will only be accepted.</li>\r\n<li>â—The solution to the case study should not exceed 5 pages excluding the cover page.</li>\r\n<li>â—The font being 12 pixels in Times New Roman.</li>\r\n<li>â—The cover page should consist of the following details : </li>\r\n<img src=\"images/111.jpg\" width=\"500px\" height=\"150\">\r\n<li>â—The PDF file should be named as follows : <strong>analyst_Case1/Case2_TeamName</strong></li>\r\n<li>â—Entries to be mailed to :    <strong> analyst@infotsav.org</strong></li>\r\n</ol>\r\n<br/>\r\n  <strong> Rules for the Final Phase:</strong><br/>\r\n    <strong> 1.</strong> The final phase will be held at IIITM, Gwalior with two sub-phases:<br/> \r\n	â— Sub-Round 1: Presentation of the solution provided to the case in Preliminary phase.<br/> \r\n	â— Sub-Round 2: A live case to be solved on-campus, which would be enclosed after presentation.  </p>\r\n\r\n\r\n',' <p align=\"justify\" style=\"font-size:14px;\">  Arpita kapoor<br/>+91-9752954812  <br/><br/>  Mohit Rangaraju<br/> +91-9770029785 <br/><br/>  Sakshi Bhambhu<br/> +91-9981405095<br/><br/>     Contact Team Analyst: analyst@infotsav.org  </p>','<strong>Â» Case 1.</strong> <br />\r\n\r\n<p align=\"justify\">James Arthur Baldwin once mockered over our love for money saying â€œMoney, it   turned out, exactly like sex, you thought of nothing else if you didn\'t have it   and thought of other things if you did.â€So you think that money is the root of   all evil. Have you ever asked what is the root of all money? Have you ever   thought who makes all the money that has lead to all major dieaseses world is   today struck with including poverty, hunger, health etc.<br />\r\n<br />\r\nWhat if we never   had money??? What if our dream of equal wealth to all is realised? Who needs to   take the lead??Thousands of economist all over the world are working towards   devising a sustainable monetary system for global economy. We should now realize   that its not hard work that makes money , neither it is an intelligent   man.<br />\r\n<br />\r\nWe here at IIITM want to fall into the shoes of an economist who   bears all pains of not being rich and thinks that Yes he can change how things   are going. Craft out a monetary system where we can wipe away the pangs of   poverty and hunger.</p>\r\n\r\n<table width=\"100%\" border=\"0\"> \r\n  <tr>\r\n    <td width=\"2%\"><a href=\"Downloads/Analyst/Case1.pdf\"><img src=\"images/dn.gif\" width=\"19\" height=\"17\" /></a></td>\r\n    <td width=\"98%\"><a href=\"Downloads/Analyst/Case1.pdf\">Case 1</a></td>\r\n  </tr>\r\n </table>\r\n <strong>Â» Case 2.</strong><br />\r\n\r\n <P align=\"justify\"> And for all those who think that changing the world is too big a task to do and they feel that Making Money is by Making Better Business, we have a place for you too. Sit into the shoes of supply chain manager of McDonald\'s and make strategies to make a better business.\r\n</P>\r\n<table width=\"100%\" border=\"0\"> \r\n  <tr>\r\n    <td width=\"2%\"><a href=\"Downloads/Analyst/Case2.pdf\"><img src=\"images/dn.gif\" width=\"19\" height=\"17\" /></a></td>\r\n    <td width=\"98%\"><a href=\"Downloads/Analyst/Case2.pdf\">Case 2</a></td>\r\n  </tr>\r\n </table>\r\n<table width=\"100%\" border=\"0\"> \r\n  <tr>\r\n    <td width=\"2%\"><a href=\"Downloads/Analyst/Analyst_Brochure.pdf\"><img src=\"images/dn.gif\" width=\"19\" height=\"17\" /></a></td>\r\n    <td width=\"98%\"><a href=\"Downloads/Analyst/Analyst_Brochure.pdf\">Analyst Brochure</a></td>\r\n  </tr>\r\n </table>',' <h4>â— Analyst-Round 1 Case uploaded.</h4><br/>   <h4>â— Cases are downloadable from the downloads link.</h4><br/><h4>â— Join the google group for any queries -<a href=\"http://groups.google.co.in/group/analyst2010?hl=en-GB\" target=\"_blank\">http://groups.google.co.in/group/analyst2010?hl=en-GB</a></h4>\r\n','Analyst . . Destine your Design to Deliver'),('10','Brouhaha','<p align=\"justify\" style=\"font-size:14px;\">Brouhaha is the advertising contest that is  held under Infotsav. It is a noisy clamorous response to a stimulus, produced  by a crowd. It can also refer to the reaction expressed over a period of time  to an event.</p>\r\n<p align=\"justify\" style=\"font-size:14px;\">Advertising is a form of communication that  typically attempts to persuade potential customers to purchase or to consume  more of a particular brand of product or service. Advertisements are designed  to generate increased consumption of those products and services through the  creation and reinforcement of \"brand image\" and \"brand  loyalty\". Every major medium is used to deliver these messages, including  television, radio, cinema, magazines, newspapers, video games, the Internet and  billboards.</p>\r\n<p align=\"justify\" style=\"font-size:14px;\">This art of emphasizing desirable qualities so  as to arouse a desire to buy has been moulded in this event, Brouhaha.</p>','<ul>\r\n   <li><strong>The event will conducted in three phases.</strong></li>\r\n</ul>\r\n<table width=\"100%\" border=\"1\">\r\n  <tr>\r\n    <td><strong>Phase  1(Online phase)</strong></td>\r\n  </tr>\r\n  <tr>\r\n    <td>It is an elimination phase as well as online  phase,the participants have to send their advertisements till October 10</td>\r\n  </tr>\r\n</table><br />\r\n<table width=\"100%\" border=\"1\">\r\n  <tr>\r\n    <td><strong>Phase 2(On-campus)</strong></td>\r\n  </tr>\r\n  <tr>\r\n    <td>The participants shortlisted have to Â Â present  their first phase product advertisement describing them in detail on Oct 29 at  the first day of Infotsav.</td>\r\n  </tr>\r\n</table><br />\r\n<table width=\"100%\" border=\"1\">\r\n  <tr>\r\n    <td><strong>Phase 3(On-campus)</strong></td>\r\n  </tr>\r\n  <tr>\r\n    <td>a) The product for the third phase will be  uploaded on Oct 11, after short listing the participants for second phase.</td>\r\n  </tr>\r\n  <tr>\r\n    <td>b)Â  The participants shortlisted for the second  phase continue to the third Â Â phase and are to present advertisements  of next product describing them in detail at the final day of INFOTSAV 10Â  i..e Oct 31.<br />\r\n</td>\r\n  </tr>\r\n</table>','<h4>General Rules :</h4>\r\n\r\n  <p align=\"justify\">â— The participants  have to make advertisements with suitable   captions or taglines for the product  or service given. The   advertisements are grouped as:<br />\r\n\r\n\r\n  Â Â Â 1. Print Advertisements.\r\n  <br />\r\n  Â Â Â 2. Audio Advertisement.\r\n  <br />\r\n  Â Â Â 3. Video Advertisement.\r\n  <br /><br />\r\n\r\n\r\n\r\n  â— Five print  advertisements, one audio advertisement and one video advertisement should be  submitted. \r\n  <br />\r\n  â— The  maximum size of a team is four. \r\n  <br />\r\n  â— Team  members can be from different colleges. \r\n  <br />\r\n  â— The  number of teams that would be shortlisted for second and   third phases will  depend on the number of teams in the first phase. \r\n  <br />\r\n  â— Product  rules will be in the case which has been<strong> uploaded</strong>. \r\n  <br />\r\n  â— The  participants are required to send the soft copy of their entry to the mail id <a href=\"mailto:brouhaha@infotsav.org\">brouhaha@infotsav.org</a>. \r\n  <br />\r\n  â— A document providing the name of the  team, members of the team,   name of the institute, e-mail addresses and contact  numbers is to be   submitted along with the advertisements. \r\n  <br />\r\n  â— The decisions of the organizers and  the Panel of Judges shall be final and will be binding on all the participants.\r\n</p>','<ul>\r\n  <li>G.Pranay KumarÂ  (pranay.kumar@infotsav.org)</li>\r\n  <p>+91 9039002082\r\n </p>\r\n  <p>Harendra Kumar  Ram (harendra.kumar@infotsav.org)</p>\r\n  <p>+91  9039415731\r\n  </p>\r\n  <p>Priya Bansal (priya.bansal@infotsav.org)</p>\r\n  +91  9329698099\r\n</ul>\r\n<p>Contact  us at â€“ <a href=\"brouhaha@infotsav.org\">brouhaha@infotsav.org</a></p>\r\n<ul>\r\n</ul>','<p><strong>â— Case Uploaded: </strong></p>\r\n<a href=\"Downloads/Brouhaha/Brouhaha Case for Phase 1 and Phase 2.rar\"><table width=\"100%\" border=\"0\">\r\n  <tr>\r\n    <td width=\"2%\"><img src=\"images/dn.gif\" width=\"19\" height=\"17\" /></td>\r\n    <td width=\"98%\">Product case for phase 1 and phase 2 (rar file)</td>\r\n  </tr>\r\n</table></a>\r\n <a href=\"Downloads/Brouhaha/Brouhaha Case for Phase 1 and Phase 2.zip\">\r\n<table width=\"100%\" border=\"0\">\r\n  <tr>\r\n    <td width=\"2%\"><img src=\"images/dn.gif\" width=\"19\" height=\"17\" /></td>\r\n    <td width=\"98%\">Produ