><h4>. 1st Prize is worth- 15,000 INR.</h4><br>   <h4>. The submission of executive summaries for the first round has been started. </h4><br>   <h4>. Last date of submission hab been extended to - 5th October .</h4><br>   <h4>. more prizes to be announced soon</h4><br>','Pinnacle . . . The Business Plan Contest'),('12','Tycoon','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/tycoon.png\"  align=\"right\"/ style=\"padding-left:20px;\"> Are you outstanding from the crowd? But we need here someone who can lead them. Competing increases you incrementally but Co-operating does it exponentially. The stage is set for you. \"Come, participate with hundreds to stand against millions\".<br/> Tycoon is the Best manager contest of Infotsav. It is a quest to determine the person who is most knowledgeable of the who\'s who of the business fraternity. The contest is an individual one to make the competition more cut throat and fierce. Add to it the elimination at each level, thus making the competition all the more ruthless. But ultimately who so ever comes out as the winner gets to taste the forbidden fruit. He/She is accorded the title of the tycoon.  </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/tycoon.png\"  align=\"right\"/ style=\"padding-left:20px;\"> The event consists of three rounds:<br/> <strong>Round 1:</strong> Aptitude Round This round tests quantitative skills of the participants and is open for all. In this round the organizers provide the participants a sheet of questions based on aptitude. Around 30 members are selected for the second round.<br/>  <strong>Round 2:</strong> Group discussion round In this round 30 (or what ever the number is) shortlisted participants are made into 5 groups, containing 6 members each, for group discussion. Each group is given a different topic on which the contestants of that particular group have to discuss. Scoring will be based on certain guidelines or norms like their fluency, content and confidence. The top 6 candidates will be promoted to the 3rd round.<br/>  <strong>Round 3:</strong> Case study round Here in the final round each participant is given a different case on which he/she has to analyze and present his/her analysis before the judges in a closed room. The contestants are given a certain time to analyze the case. Scoring will again be based on the aforesaid guidelines and norms. Note: Scores of the previous rounds are not carried out to next rounds. The decision of the organizers is final in any round.   </p>','  <p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/tycoon.png\"  align=\"right\"  style=\"padding-left:20px;\"> Rules will be provided on site for the each phase.Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  <br/><br/><br/><br/><br/><br/><br/><br/> </p>','<p align=\"justify\" style=\"font-size:14px;\"> <p>Arpan Khare (+91-9406989940)<br />\r\nAbhishek Jha (+91-9009751941)<br />\r\nDinesh Baisla (+91-9770030358)</p> <br/>E-mail us at:<br/> tycoon[at]infotsav[dot]org <br/><br/><br/><br/><br/> </p>','',' <h4>â— A 16 hr Ethical Hacking & Information Security Workshop on 29th - 30th Oct during Infotsav by Kyrion Technologies.</h4><br/>   <h4>â— A 2 days workshop on Automobile Mechanics & Engine Design by Emanagineer India.</h4><br/>   <h4>â— A session by Yashwant Kanetkar , the renowed author of \"Let Us C\" and more.</h4><br/>','Tycoon . . . The Best Manager Contest'),('13','Bull Fight','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/bull.png\"  align=\"right\" style=\"padding-left:20px;\">    \'Bullfight\' is the perfect introduction to the stock market for gamers! \'Bull\' means nothing wild. This is the much common word used today in business world to depict the investors who risk their money in today\'s tentative market, expecting good returns. Bull-fight symbolizes the ongoing brawl among the \'Bulls\', for profit...<br/> This game is a simulation of some common aspects of \'stock exchange\' trying to figure out the exact perplexity while investing your money in a very unpredictable market. There you can buy, sell, and check on stocks wherever you can get online.  </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/bull.png\"  align=\"right\"/ style=\"padding-left:20px;\"> <strong>1.</strong> No entry fee is required.<br/> <strong>2.</strong> The prize will be awarded based upon player ranking at the end of the contest period.<br/> <strong>3.</strong> A valid identification is required to redeem prizes.<br/> <strong>4.</strong> All disputes will be resolved by the contest organizer whose decision is final.<br/> <strong>5.</strong> Fraud, forgery, or other acts of dishonesty will disqualify contest user or participants.<br/> <strong>6.</strong> There will be three initial preliminary rounds from each round top 25 participants will get a chance to fight in the final simulation.<br/> </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/bull.png\"  align=\"right\"/ style=\"padding-left:20px;\"> <strong>1.</strong> A company is listed on the stock exchange when its IPO offerings have closed.<br/> <strong>2.</strong> Regular news would be floated into the market depicting the financial scene and regarding the other factors that influence the stock prices. This is the main driving force for the market.<br/> <strong>3.</strong> Fluctuating price of the stock would be cumulatively depicted by an index -- \'Bullex\'.<br/> <strong>4.</strong> Final winners would be judged according his bank balance and the liquidity of his shares. Liquidity of shares is a function of average price of last few transactions of shares of all the listed companies.<br/> <strong>5.</strong> The bids applied by any player will be placed in the market after a random time interval.<br/> </p>','<p align=\"justify\" style=\"font-size:14px;\">   Anurag Singh<br/> +91-9009209269<br/><br/>  Prashank Gupta<br/>  +91-9479934473<br/><br/>  Umesh Dhruv<br/> +91-9826181983<br/><br/>      Contact Team BullFight: bullfight@infotsav.org </p>','',' <h4>&#9679 A 16 hr Ethical Hacking & Information Security Workshop on 29th - 30th Oct during Infotsav by Kyrion Technologies.</h4><br/>   <h4>&#9679 A 2 days workshop on Automobile Mechanics & Engine Design by Emanagineer India.</h4><br/>   <h4>&#9679 A session by Yashwant Kanetkar , the renowed author of \"Let Us C\" and more.</h4><br/>   <h4>&#9679 Registration will start from 23rd August 2010</h4><br/>','Bull Fight . . . The Stock Simulation Game'),('14','Forex','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/forex.png\"  align=\"right\" style=\"padding-left:20px;\"> Forex is the simulation of by far the largest financial market in the world that includes trading between central banks, currency speculators, multinational corporations, governments and other financial institutions. This game provides a platform where the players can convert virtual money from one currency to another. The player who has the maximum balance wins. The Foreign Exchange market exists whenever one currency is traded for another. It gives a real time experience of the \"foreign exchange\" provided with virtual money and real time data to get the invaluable hand on experience.       </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/forex.png\"  align=\"right\" style=\"padding-left:20px;\">  To be uploaded soon...&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/>   </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/forex.png\"  align=\"right\"/ style=\"padding-left:20px;\">   <strong>1.</strong>	The game will be played for a period of about 2 weeks.<br/> <strong>2.</strong>	Anyone with a correct user id and password can access the pages and do the trading.<br/> <strong>3.</strong>	A participant can make his/her another account only if his earlier account is freezed. In case it is found that the participant has created more than one user id he/she shall be disqualified. In case of any discrepancy organizers\' decisions will be final.<br/> <strong>4.</strong>	There is only one round this time.<br/> <strong>5.</strong>	In this round the participants have to trade with the virtual amount of $ one lakh.<br/> <strong>6.</strong>	In case of tie, the judge\'s decision will be final.<br/> <strong>7.</strong>	Rank will be calculated after every hour.<br/> <strong>8.</strong>	The top ten players (as according to the rank) will be scrutinized for any fraud or fake transactions. The Final Winners shall be then intimated through mail and a list will be put up on the website.<br/>    </p>',' <p align=\"justify\" style=\"font-size:14px;\">   Alok Nayak<br/> +91 9009444302<br/><br/>  Ashok Ranganathan<br/> +91 9009251959<br/><br/>   Girish Kumar<br/> +91 9827219365<br/><br/>       Contact Team Forex: forex@infotsav.org   </p>','',' <h4>&#9679 A 16 hr Ethical Hacking & Information Security Workshop on 29th - 30th Oct during Infotsav by Kyrion Technologies.</h4><br/>   <h4>&#9679 A 2 days workshop on Automobile Mechanics & Engine Design by Emanagineer India.</h4><br/>   <h4>&#9679 A session by Yashwant Kanetkar , the renowed author of \"Let Us C\" and more.</h4><br/>   <h4>&#9679 Registration will start from 23rd August 2010</h4><br/>','Forex . . . The Foreign Exchange Market Simulation'),('15','Stock Sutra','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/stock.png\"  align=\"right\" style=\"padding-left:20px;\"> An event in which the investment acumen of the contestants is tested where the contestants have to invest in stocks and have to explain their investment strategy. In the present accelerating growth period of the Indian economy, banks and other financial institutions are in acute need of good analytical minds for their investment decisions. To gain advantage, such analysts need to resort to new ways of forecasting future business trends.The core concepts of computational mathematics like Statistical Learning, Data Mining etc are gaining importance. Contestants would find a new avenue to apply their analytical skills and their technical skills gained as part of their curriculum for the present financial problems. This would open up a new line of research for students aspiring to enter in the field of finance.   </p>',' <p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/stock.png\"  align=\"right\"/ style=\"padding-left:20px;\">  <strong>1.</strong> The event is an equity research contest aiming at attracting the best of talents to apply their skills and knowledge towards framing their investment strategy, which will be put to test in the real market. This will help to bridge the gap between theory and practice, giving students a first hand experience of stock market. The event provides a strong base for all future investors.<br/> <strong>2.</strong>  The event will be played online for about two weeks. The participants registering are provided an initial amount of Rs. 1,00,000 and required to trade in stocks from the NIFTY index and NIFTY JUNIOR index.<br/> <strong>3.</strong> The game is a test of analyzing and diagnosing powers of participants as some shares tumble and some soar at the stock market during the contest period. The participants are free to trade during market open and close hours. At the end of three weeks,the top 10 participants with the highest net worth are invited to institute campus to justify their choice of stocks.   </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/stock.png\"  align=\"right\"  style=\"padding-left:20px;\">   <strong>1.</strong>The game will be played for a period of about 2 weeks.<br/>   <strong>2.</strong>Anyone with a correct user id and password can access the pages and do the trading.<br/>   <strong>3.</strong>In case it is found that the participant has created more than one user id he/she shall    be disqualified. In case of any discrepancy organizers\' decisions will be final.<br/>   <strong>4.</strong>There is just 1 round in this event<br/>    <strong>5.</strong>Teams are made consisting of single member only.<br/>     <strong>6.</strong> Trading Hours: Only during the market hours.<br/>   * The participants have to trade with the virtual amount of Rs. One lakh. The market prices will be as per the NSE.   </p>  ','<p align=\"justify\" style=\"font-size:14px;\">      Gaurav Yadav<br/> +91 9893098414<br/><br/>   Swapnil Srivastava<br/> +91 9406989981<br/><br/> Vinod Gaur<br/> +91 9098476474<br/><br/><br/>      Contact Team StockSutra : stocksutra@infotsav.org  </p>','',' <h4>&#9679 A 16 hr Ethical Hacking & Information Security Workshop on 29th - 30th Oct during Infotsav by Kyrion Technologies.</h4><br/>   <h4>&#9679 A 2 days workshop on Automobile Mechanics & Engine Design by Emanagineer India.</h4><br/>   <h4>&#9679 A session by Yashwant Kanetkar , the renowed author of \"Let Us C\" and more.</h4><br/>   <h4>&#9679 Registration will start from 23rd August 2010</h4><br/>','Stock Sutra . . . The Equity Research Contest'),('16','Trove Trace','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/trove.png\"  align=\"right\" style=\"padding-left:20px;\">  Trove Trace is an Online Crypto graphical puzzling contest to be organized under Infotsav\'2010 (29-31 Oct, 2010) where you are expected to cross the hurdles of some brain cracking problems of subsequent toughness to emerge as the winner. It\'s one of the best brain teasing game and who knows, you may actually learn something along the way. <br /> First trial round is going to start soon. Do keep checking http://infotsav.org for updates. Lots of goodies and other exciting stuff is up for grab for trial round winners. So put on your thinking cap, get your brain in gear, and set your train of thought in motion down the tracks.  </p> ','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/trove.png\"  align=\"right\" style=\"padding-left:20px;\"> The trove trace would be based on a theme . Each question would have some secret message associated with it,running with the theme, which you would need to decode in order to move ahead in the game. Answer to the current level would provide you the link to the next level.<br/> The time taken to solve each level would be recorded, & would be used for judging, for more details see rules. Each time you are directed to a new level, time is noted & when you submit that answer the time would again be recorded.   </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/trove.png\"  align=\"right\" style=\"padding-left:20px;\"> <strong>1.</strong> The participant who solves the maximum no of questions would be declared as the winner.<br/> <strong>2.</strong> In case of more than one participant solving the equal number of questions, the one who solves earliar would be declared as the winner.<br/> <strong>3.</strong> There will be forum for every question seperately for your help and query.<br/> <strong>4.</strong> Prizes are up for the grab for 2nd & 3rd spot as well.<br/> <strong>5.</strong> Anyone caught cheating or trying to post answers on forum would be disqualified.<br/> <strong>6.</strong> The discretion & judgement of the organizers is final.<br/> <strong>7.</strong> Maximum team size should not exceed more than 2.<br/>    </p>',' <p align=\"justify\" style=\"font-size:14px;\">    Ashish Chaudhary<br/> +91 9009461169 <br/><br/>  Prabhat Gupta<br/> +91 9009461159 <br/><br/>    Purushottam Kushwaha<br/> +91 9407204628 <br/><br/>  <br/> Contact Team TroveTrace: trovetrace@infotsav.org </p>','',' <h4>â— A 16 hr Ethical Hacking & Information Security Workshop on 29th - 30th Oct during Infotsav by Kyrion Technologies.</h4><br/>   <h4>â— A 2 days workshop on Automobile Mechanics & Engine Design by Emanagineer India.</h4><br/>   <h4>â— A session by Yashwant Kanetkar , the renowed author of \"Let Us C\" and more.</h4><br/>   <h4>â— Registration will start from 1st September 2010</h4><br/>','Trove Trace . . . The Treasure Hunt'),('17','Sameeksha','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/sameeksha.png\"  align=\"right\" style=\"padding-left:20px;\">      The toughest job for mankind is to do the job the easiest way and since ages man has been effortlessly trying to do the same. Techno-management is the theme of Sameeksha-the annual national paper presentation contest that stages brilliant ideas and innovations in the field of technology and management and allows young researchers and students both at UG/PG level to bring forth the novice ideas that they have worked upon.<br />  Sameeksha has been giving great opportunities for exploring new dimensions of knowledge, understanding the needs and identifying the best perspectives for the future. In our constant effort to make Sameeksha stand away from the crowd of similar competitions we ensure that the papers get evaluated by the most renowned and eminent scholars and well known figures from the business industry thus highlighting those hidden aspects that can spur blunders.     </p>  ',' <table width=\"100%\" border=\"1\">\r\n  		          <tr>\r\n  		            <td width=\"35%\">â—Online Submission of papers:</td>\r\n  		            <td width=\"65%\">2<sup>nd</sup> October, 2010 11:00 pm</td>\r\n	              </tr>\r\n  		          <tr>\r\n  		            <td>â—On campus presentation:</td>\r\n  		            <td>30<sup>th</sup> October, 2010</td>\r\n	              </tr>\r\n	            </table>','<p align=\"justify\"> â— Participants can be UG/PG/Research Scholars.<br />\r\nâ— A team consists of maximum four members and an individual can be a part of just one team, however there can be any number of entries from a T-school or a B-school. <br />\r\nâ—The paper should not exceed 15 pages or 3000 words, whichever is lesser (including everything except the annexure). <br />\r\nâ— The soft copies of papers must be typed in Microsoft Office with font Times New Roman, font size 12 and a line spacing of 1.5 strictly. Headings and sub-headings can be Bold and font size needs to be 14 and 12 respectively. <br />\r\nâ— The papers must follow Harvard style of referencing. <br />\r\nThe papers should be original in their content and not published anywhere else. <br />\r\nâ— Each entry should have a cover page mentioning names of the author(s), field chosen and the topic of the paper, addresses, and e-mail and telephone numbers. This cover page shall be detached before the papers are given for panel evaluation. The name(s) of the author(s) or their institute should not appear anywhere in the body of the paper. <br />\r\nâ— The file should be strictly in .pdf format. <br />\r\nâ— The participants are required to send the soft copy of their entry to the mail id sameeksha@infotsav.org. <br />\r\nâ— The acknowledgment for the receipt of papers shall be sent within 24 hours of submission.<br />\r\nâ— The decisions of the organizers of Sameeksha and the Panel of Judges shall be final and will be binding on all the participants. <br />\r\nâ— Failure to comply with any of the rules above will lead to disqualification. <br />\r\nâ— The submitted papers shall become the property of Sameeksha.<br />\r\n				</p>','<p align=\"justify\" style=\"font-size:14px;\">  			  Chaitanya Gupta<br/> +91 9009752059<br/><br/>  Devashree Roy<br/>  <br/><br/>   Rahul Goyal<br/> +91 9009688566<br/><br/>  Shikha Goyal<br/> +91 9770876542<br/><br/>  Sidharth Singh<br/> +91 9258740019<br/><br/>   Contact Team Sameeksha: sameeksha@infotsav.org </p>',' <a href=\"Downloads/Sameeksha/Sameeksha.pdf\"><table width=\"100%\" border=\"0\">\r\n  <tr>\r\n    <td width=\"2%\"><img src=\"images/dn.gif\" width=\"19\" height=\"17\" /></td>\r\n    <td width=\"98%\">Information Brouchure</td>\r\n  </tr>\r\n</table>\r\n</a>',' <h4>â— <strong>Sameeksha-</strong> The National level Paper Presentation Contest calls in for papers from students/ researchers. Kindly make your submissions to sameeksha[at]infotsav[dot]org. </h4>','Sameeksha . . . The Paper Presentation'),('18','Chakravyuh',' <p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/chakra.png\"  align=\"right\" style=\"padding-left:20px;\">\r\n Chakravyuh is a kind of formation consist of some concentric round of techno-management skills where you have to exhibit your talents and assimilate new ideas to break a formation of chakravyuh. This event is primarily focused on providing a challenging platform for intellectual brains where you need to be cognizant of both technology and management .<br /><br />\r\n \r\nPrize Money<br/><br/>\r\n  First Prize &nbsp;&nbsp;&nbsp;&nbsp;:    Rs.6000<br/>\r\n	Second Prize :    Rs.4000<br/>\r\n \r\n \r\n \r\n <br /><br />    </p>',' <p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/chakra.png\"  align=\"right\" style=\"padding-left:20px;\">  To be uploaded soon...Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â <br />   <br /><br /><br /><br /><br /><br /><br /><br /><br /><br />   				 </p> ','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/chakra.png\"  align=\"right\"/ style=\"padding-left:20px;\"> 				 <strong>1.</strong> All participants have to register themselves. No body will be given on the spot entry.<br/> <strong>2.</strong> Nature of round will be declared to the participants just before starting of each round.<br/> <strong>3.</strong> Points earned in each Round will be carried forward to the subsequent Rounds.<br/> <strong>4.</strong> For non-IIITM students Pre-final round will be held .<br/> <strong>5.</strong> Winners of technical and management events will be awarded BONUS points ONLY if they participate in the pre-final rounds of Chakravyuh.<br/> <strong>6.</strong> The decisions made by the organizers during or after the course of the event will be FINAL.<br/>  </p>','  <p align=\"justify\" style=\"font-size:14px;\"> Achyut Shukla<br/> +91 9926963971 <br/><br/> Thomas Mammen Tharakan<br/> +91 9200299893 <br/><br/>			 Ashutosh Gautam<br/> +91 9691980336 <br/><br/>  Duyu Komo<br/> +91 9691980342 <br/><br/>  Surbhi Jain<br/> +91 9406971324 <br/><br/><br/>    Contact Team Chakravyuh: chakravyuh@infotsav.org </p>','',' <h4>â— A 16 hr Ethical Hacking & Information Security Workshop on 29th - 30th Oct during Infotsav by Kyrion Technologies.</h4><br/>   <h4>â— A 2 days workshop on Automobile Mechanics & Engine Design by Emanagineer India.</h4><br/>   <h4>â— A session by Yashwant Kanetkar , the renowed author of \"Let Us C\" and more.</h4>','Chakravyuh . . . The Grand Finale Of Infotsav'),('19','Gamiacs','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/gamiacs.png\"  align=\"right\"/ style=\"padding-left:20px;\"> 				 The battle of the virtual world has begun. Are you game? This Infotsav 10 the world will be rocked by the cyber warriors. Gamiacs is back with a bang. And this time it\'s not only more competitive and tougher but it has added an all new dimension in its already humungous artillery of entertainment. <br /> This time round 4 different games will be organized to bring out the ultimate gamer who resides somewhere in you! So gear up, reload thy guns, sharpen you knifes and prepare for the ultimate burnout. </p>',' <p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/gamiacs.png\"  align=\"right\"/ style=\"padding-left:20px;\"> 				 This year a total of four games will be organized under Gamiacs. The details are as follows:<br/> <strong>1.</strong> Counter Strike 1.6<br/> <strong>2.</strong>  Quake 3<br/> <strong>3.</strong> Age of Empires<br/> <strong>4.</strong>  Need for Speed Hot Pursuit 2<br/> </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/gamiacs.png\"  align=\"right\"/ style=\"padding-left:20px;\"> 				 The participants must register themselves before the last date of registration. No   participation will be allowed after the last date of registration.<br/> <strong>1.</strong> For participation in team events, the participants must submit the names and contact of all   the team members along with a clan name.<br/> <strong>2.</strong> Kindly note that a participant must register in only one team in an event. Multiple   registrations can lead to disqualification.<br/> <strong>3.</strong> A maximum of 15 minutes time will be granted to teams to assemble before their slot.<br/> <strong>4.</strong> The teams failing to arrive on time at their slot will be disqualified thereby giving their   opponents a walk over.<br/> <strong>5.</strong> The participant found using unfair means will be disqualified immediately.<br/> <strong>6.</strong> In case of any argument the decision of the organisers will be considered final.<br/> </p>',' <p align=\"justify\" style=\"font-size:14px;\"> <br/><br/><br/> 				   Contact Team Gamiacs: gamiacs@infotsav.org <br/><br/><br/><br/><br/><br/><br/></p>','',' <h4>&#9679 A 16 hr Ethical Hacking & Information Security Workshop on 29th - 30th Oct during Infotsav by Kyrion Technologies.</h4><br/>   <h4>&#9679 A 2 days workshop on Automobile Mechanics & Engine Design by Emanagineer India.</h4><br/>   <h4>&#9679 A session by Yashwant Kanetkar , the renowed author of \"Let Us C\" and more.</h4><br/>   <h4>&#9679 Registration will start from 23rd August 2010</h4><br/>','Gamiacs . . . Arena awaits the maniacs'),('20','autonex','<img src=\" wrk images/11.jpg\"   style=\"padding-left:20px;\">  <p align=\"justify\" style=\"font-size:14px;\">  <strong>Emanagineer India</strong> aims to give India\'s most reputed workshop in the field of Automotive Mechanics and Engine Design. It aims to train participants and produce skilled technocrat and equips them with all the tools, techniques and methods needed for automobile industry. Emanagineer India had trained more than 3,000 participants across India in various workshop fields. These Workshops are intended to produce technocrats for the next generation. The live interactive sessions, and real life examples will take participants inside the minds of a technocrats. </p> <p style=\"font-size:18px\">Key Benefits</p> <p align=\"justify\" style=\"font-size:14px;\"> <strong>1.</strong> We will be providing the students knowledge in the field of Automotive Mechanics and Engine Design by giving them knowledge of all the automotive systems and introducing them to the needs of the current automotive sector.<br/><br/> <strong>2.</strong> Trainings will be provided by core professionals in their fields.  </p>','<img src=\" wrk images/11.jpg\"   style=\"padding-left:20px;\">    <p align=\"justify\" style=\"font-size:14px;\"> The topics to be discussed in AutoNEX are given below :<br/> &#9679 Introduction<br/> &#9679 Types of locomotive vehicles<br/> &#9679 Chassis design<br/> &#9679 Suspension Unit<br/> &#9679 Spring Rate<br/> &#9679 Type of Suspension<br/> &#9679 Rear suspension & dependent type<br/> &#9679 Braking Unit<br/> &#9679 Designing Using Software- AUTOCAD AND CATIA <br/> &#9679 Types of Transmission system<br/> &#9679 Tyres and Traction Control<br/> &#9679 Engine Design.<br/>  </p>','<img src=\" wrk images/11.jpg\"   style=\"padding-left:20px;\">   <p style=\"font-size:18px\">Course Duration</p> <p align=\"justify\" style=\"font-size:14px;\"> 16 hours (To be covered in 2 days) </p>   <p style=\"font-size:18px\">Eligibilty Criteria</p> <p align=\"justify\" style=\"font-size:14px;\"> All students/professionals having an interest in automobile sector are eligible to attend this workshop. The Prerequisite for joining this workshop is zero and it is a basic level workshop. </p> <p style=\"font-size:18px\">Fees</p> <p align=\"justify\" style=\"font-size:14px;\"> <strong>Rs. 1100</strong> per participant.<br/> The fees include study material, Certification, human resources and other charges. </p>','<img src=\" wrk images/11.jpg\"   style=\"padding-left:20px;\">  <p style=\"font-size:18px\">Workshop Highlights</p> <p align=\"justify\" style=\"font-size:14px;\"> &#9679 All of the participants will get the \"Certificate of Participation\" from Emanagineer India.<br/>  &#9679 Comprehensive Study Material for each participant.<br/> &#9679 Demonstration Packs & Required Software (if necessary.)<br/> &#9679 Receive an unparalleled education from Emanagineer team with personal one-on-one attention..<br/> &#9679 Emanagineer India certification programs are recognized in industry.<br/> &#9679 Improve job prospects and get an edge over your counterparts.<br/> &#9679 Interactive Query sessions, Live Demos, PowerPoint Presentations, animation of open engine.<br/> &#9679 Practical explanations using stimulated models.<br/>  </p>','','',''),('21','ehis',' <img src=\" wrk images/12.png\"   style=\"padding-left:20px;\" align=\"left\">  <p align=\"justify\" style=\"font-size:14px;\">  <b>Kyrion Technologies Pvt. Ltd.</b>, an IIT Delhi Alumni Venture, aims to lay a strong underpinning for the technical development of our country, by developing an active interest among youth in new technologies such as Ethical Hacking & Information Security.   </p> <p align=\"justify\" style=\"font-size:14px;\">  Kyrion Digital Securities at Kyrion Technologies Pvt. Ltd. has been founded by a group of IT Security Experts & Professors of Top Engineering Colleges such as IISc, IIT & NITs. It has laid a foundation in the field of Ethical Hacking & Information Security. Kyrion Digital Securities has conceptualized various workshops, products and resources to cater the needs of different section of students\' communities and eventually reaching out to an excess of 10,000 students and tutors in different cities across the country.  </p>  ',' <img src=\" wrk images/12.png\"   style=\"padding-left:20px;\" align=\"left\">  <p align=\"justify\" style=\"font-size:14px;\">  <b>Kyrion Technologies Pvt. Ltd.</b>, an IIT Delhi Alumni Venture, aims to lay a strong underpinning for the technical development of our country, by developing an active interest among youth in new technologies such as Ethical Hacking & Information Security.   </p> <p align=\"justify\" style=\"font-size:14px;\">  Kyrion Digital Securities at Kyrion Technologies Pvt. Ltd. has been founded by a group of IT Security Experts & Professors of Top Engineering Colleges such as IISc, IIT & NITs. It has laid a foundation in the field of Ethical Hacking & Information Security. Kyrion Digital Securities has conceptualized various workshops, products and resources to cater the needs of different section of students\' communities and eventually reaching out to an excess of 10,000 students and tutors in different cities across the country.  </p>','<p style=\"font-size:14px\" align=\"justify\"> <h4 style=\"font-size:14px\">Concept of Ethical Hacking</h4>  &#9679 Reading the Hacker\'s mind and Understanding the hacking psychology and methodology<br/> &#9679 Ethical Hacking and Penetration Testing<br/> <h4 style=\"font-size:14px\">Email Hacking</h4> &#9679 Email Servers <br/> &#9679 Email Forgery and Spamming<br/> &#9679 Email Password Attacks<br/> &#9679 Email Account Security<br/> <h4 style=\"font-size:14px\">Windows Hacking and Security</h4> &#9679 Windows System Architecture<br/> &#9679 Targeting a Windows System<br/> &#9679 Windows System Security<br/> <h4 style=\"font-size:14px\">Trojans</h4> &#9679 Concept of Trojan<br/> &#9679 Controlling Trojans<br/>  <h4 style=\"font-size:14px\">Web Server as a Target</h4> &#9679 Web Technologies<br/> &#9679 Web Application Attacks: Live Demonstrations<br/>   <h4 style=\"font-size:14px\">Wireless Hacking</h4>  &#9679 Wireless Network Concepts<br/> &#9679 Wireless Attacks<br/>   </p>',' <img src=\" wrk images/12.png\"   style=\"padding-left:20px; padding-bottom:10px;\" align=\"left\" >  <p style=\"font-size:18px\">Downloads</p> <p align=\"justify\" style=\"font-size:14px;\">    <a href=\"Kyrion.pdf\" target=\"_blank\"><img src=images/dn.gif align=\"absmiddle\" style=\"padding-right:10PX;\">Download the course structure</a>  </p>','','','Ethical Hacking & Information Security'),('22','Job Bureau','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/job.png\"  align=\"right\" style=\"padding-left:20px;\">  Want to get hired!!!<br/> Get to use the world\'s latest technologies and software.<br/> It\'s time for you to experience the professional serene and achieve what you desire and are really capable of. Infotsav gives you a chance to get placed before the actual campus drive in a virtual world where you learn to be an efficient project leader and a skilled coder. The simulation takes you into the flock of assignments where you move ahead by gaining experience and money.<br/> All the tech savvies get ready for the thrill <br/> If you want to make your bureau chill !!!!!<br/>            </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/job.png\"  align=\"right\" style=\"padding-left:20px;\">  Details: 1.As soon as you register, you become a freelancer/software engineer/project leader who gets paid for completing tasks of various companies. The user is provided with a laptop of basic configuration with fully charged battery.<br/> 2.The criteria for completing a task include your battery level and fulfilment of minimum requirements by a task which may include various softwares and hardware.<br/> 3.The tasks are categorized into three levels.<br/> 4.One can accomplish tasks with the help of online \"Buddies\".<br/> 5.User will get paid for completing a task and gains experience associated with that task.<br/> 6. The battery gets consumed in doing a task/job. If battery gets over, one needs to wait for sometime to recharge the battery or buy a power booster for the laptop for instant recharge.<br/> 7.User can upgrade his/her system by buying available packages (hardware and software).<br/>             </p>','<p align=\"justify\" style=\"font-size:14px;\">  <img src=\"db images/job.png\"  align=\"right\" style=\"padding-left:20px;\">  1.The game will be played for a period of about 2 weeks.<br/> 2.Anyone with a correct user id and password can access Job Bureau.<br/> 3.The tasks will be updated from time to time and sometimes a task with bonus will also be released.<br/> 4.The basis of ranking is the \"experience\" gained by the user.<br/> 5.There are three basic tasks kept for the user in case if he runs out of money. These tasks will not give him experience.<br/>             </p>','<p align=\"justify\" style=\"font-size:14px;\">   Chaitanya Gupta<br/> +91-9009752059<br/><br/>  Swapnil Srivastava<br/> +91-9406989981<br/><br/>                </p>','',' <h4>&#9679 A 16 hr Ethical Hacking & Information Security Workshop on 29th - 30th Oct during Infotsav by Kyrion Technologies.</h4><br/>   <h4>&#9679 A 2 days workshop on Automobile Mechanics & Engine Design by Emanagineer India.</h4><br/>   <h4>&#9679 A session by Yashwant Kanetkar , the renowed author of \"Let Us C\" and more.</h4><br/>   <h4>&#9679 Registration will start from 23rd August 2010</h4><br/>',''),('23','Exhibition','   <p align=\"justify\" style=\"font-size:14px;\">  Young minds are always full of fresh ideas and to ensure a continuous development of the society it\'s very important to Nurture these ideas. This is what Infotsav\'10 with its theme Nurturing Novelty aims to succeed in. That is why a <b>national level SCHOOL science exhibition</b> is being organised for the first time under Infotsav\'10 to hunt for talented young minds of the country and to reward there innovativeness. </p>  <p align=\"justify\" style=\"font-size:14px;\">  Prize money :<br/> â—First prize: Rs 4000<br/>  â— Second prize:  Rs 2000<br/> â—Third prize:      Rs 1000<br/>   </p>',' <p align=\"justify\" style=\"font-size:14px;\"> â— Event will be organized on 29th & 30th of October.<br/> â— Team size: <br/> Â Â Â Â Only students from 9th to 12th standard are eligible.<br/> Â Â Â Â A school can send a maximum of 3 teams.<br/> Â Â Â Â Maximum 3 students per team.<br/> Â Â Â Â We would highly appreciate the different teams to be accompanied by a teacher/faculty, certificates would also be provided to the faculty.<br/> â—Last date of confirmation is 15th of October, 2010.<br/> â—Registration fee for the Event is Rs.150/- per team. <br/> â—Confirmation can be made through email, post, telephone or through our online registration portal.  <br/> â—Lodging & food will be provided from the 28th night to the 30th night. Separate hostels will be provided to boys and girls.<br/> â—No travel allowances will be provided.<br/>  â—The winning projects will become the property of the institute.<br/> â—In case of any misleading finding or the use of unfair means related to your project, if found, will lead to immediate disqualification of the concerned team.<br/> â—The decisions of the judges will be final and binding.<br/> â—Various workshops/seminars, quizzes, events and interactive sessions with eminent personalities from academics/industry related to technologies as well as management will be organized for nurturing the young minds of the school students. The students can participate in these and learn a lot of new things.<br/> â—National level participation certificates will be provided to all the team members.<br/> â—A lot of other Infotsav\'10 goodies and gifts are also up for grabs for the students who show a lot of enthusiasm in the different events.<br/>    </p>','     <p align=\"justify\" style=\"font-size:14px;\"> â—Model can be working as well as non-working.<br/> â—The model should be accompanied by project report which may comprise of the following:<br/> Â Â Â Â Description about the theory, concept or principle.<br/> Â Â Â Â A chart on the project.<br/> Â Â Â Â List of the components used.<br/>  Â Â Â Â Instructions on working of the project (if applicable).<br/> Â Â Â Â Application of the project in real world.<br/> â—Language of the instructions can either be in English or Hindi.<br/> â—Marking Scheme:<br/> Â Â Â Â Model/Setup (Working or Non-Working)Â Â Â Â Â Â Â Â Â Â Creativity and innovation  Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Scientific thought/principle/approach  Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Charts and Project Report Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  Â Â Â Â Presentation-Explanation and demonstration  </p>','    <p align=\"justify\" style=\"font-size:14px;\">  <h4>Main Theme: Science and Society</h4> Sub-Themes:<br/>  â—Science in Everyday Life<br/> â—Harnessing and Conserving Energy<br/>  Guidelines for preparation of Exhibits and Models<br/> The importance of every sub-theme in the context of main theme and a number of Suggestions for designing the exhibits/projects are given below. However, these ideas are only suggestive.<br/><br/> <b>Participants are free to develop exhibits based on other related ideas of their choice.</b><br/>   <h4>Sub-Theme 1: Science in Everyday Life</h4> Science has become a part of our Day to Day life. We can\'t imagine a day without having Science based equipments helping us in our activities.<br/> â—Construct and explain the working of Burglar Alarm systems<br/> â—Make models on Rain Alarms, Photocopy Machines, Vacuum Cleaners and other equipments used in our day to day activities.<br/> â—Construct and explain the working of Rain Water Harvester and other such devices which conserve water etc.<br/> â—Water Purification systems and other pollution control systems.<br/> â—Use of eco-friendly and innovative devices that may help in combating climate change.<br/>  <h4>Sub-theme 2:   Harnessing and Conservation of Energy</h4> Everything we do today requires some form of energy to function be it Petrol to run your cars or Cells and Batteries to run your Mobile Phones, Laptops etc. Finding new sources of energy whilst conserving and developing those which we already have are very important.<br/> â—Demonstrate how to harness energy from different raw materials like Flowers, Potatoes and Lemons etc.<br/> â—Make models and explain the working of Energy conservation utilities like Auto Switch Off of Lights and Fans when someone leaves the room etc.<br/> â—Harness renewable sources of energy using Wind Mills, Solar Cells etc.<br/> â—Construct and explain working of DC/AC motors etc. <br/> â—Energy from biomass, Improved designs of biogas/biomass plant<br/> â—Solar thermal electricity/community solar project<br/> â—Innovative designs of solar cooker/solar distiller/solar dryer for food processing/solar heated houses.<br/>   </p>','<table width=\"100%\" border=\"0\"> <a href=\"Downloads/Exhibition/Information Brouchure.pdf\">\r\n  <tr>\r\n    <td width=\"2%\"><img src=\"images/dn.gif\" width=\"19\" height=\"17\" /></td>\r\n    <td width=\"98%\">Information Brouchure</td>\r\n  </tr></a>\r\n <a href=\"Downloads/Exhibition/Exhibition.jpg\"><tr>\r\n    <td width=\"2%\"><img src=\"images/dn.gif\" width=\"19\" height=\"17\" /></td>\r\n    <td width=\"98%\">Information Brouchure</td>\r\n  </tr></a>\r\n</table>\r\n','','Social Science Exhibition');
