INSERT INTO `news_feed` VALUES ('You may chat with us on skype, our skype id is \"Infotsav\" (without quotes).\r\n','2010-06-09 07:42:57',1),('The Infotsav 2010 site is Lunched, Subscribe on it to stay connected.','2010-06-09 07:43:57',0),('The Infotsav 2010 site is Launched, Subscribe on it to stay connected.','2010-06-10 07:39:09',0),('Infotsav 2010 site launched. Subscribe to stay connected.','2010-06-10 07:41:34',0),('A 16 hr Ethical Hacking Workshop on 29th-30th Oct during Infotsav, by Kyrion Technologies.','2010-08-06 18:44:54',1),('A session by Yeshvant Kanetkar, the renowned author of \"Let Us C\" on the 30th of Oct.','2010-08-06 18:51:11',0),('A session by Yashavant Kanetkar, the renowned author of \"Let Us C\" and more.','2010-08-06 20:16:51',1),('A two days workshop on Automobile Mechanics & Engine Design by Emanagineer India on 29th-30th October.','2010-08-18 10:14:53',0),('A two days workshop on Automobile Mechanics & Engine Design by Emanagineer India.','2010-08-18 10:15:49',1);
